import React from "react";
import styles from "../../styles/ItemPage.module.css";

export const DeliveryCard = () => {
  return (
    <>
      <div className={styles.DeliveryCardFirst}>
        <svg
          width="34"
          height="22"
          viewBox="0 0 34 22"
          fill="none"
          xmlns="http://www.w3.org/2000/svg"
        >
          <path
            d="M6 21H4.66667C3.5621 21 2.66667 20.1046 2.66667 19V14.3333M1 1H17.3333C18.4379 1 19.3333 1.89543 19.3333 3V21M13 21H22.6667M30 21H30.6667C31.7712 21 32.6667 20.1046 32.6667 19V11M32.6667 11H19.3333M32.6667 11L28.2493 3.63768C27.8878 3.03526 27.2368 2.66667 26.5343 2.66667H19.3333"
            stroke="black"
            stroke-width="2"
            stroke-linecap="round"
            stroke-linejoin="round"
          />
        </svg>
      </div>
      <div className={styles.DeliveryCardSecond}>Second section</div>
    </>
  );
};
